struct Pilha* buscar_reduz(struct Celula *grafo){
    struct Pilha *stack = calloc(1, sizeof(struct Pilha));
    stack->cell = grafo;
    grafo = grafo->esquerda;
    do{
        struct Pilha *aux = calloc(1, sizeof(struct Pilha));
        aux->cell = grafo;
        aux->next = stack;
        stack = aux;
        grafo = grafo->esquerda;
    }while(grafo);

    return stack;
}

void reduz_K(struct Pilha *stack){
    struct Celula *a = stack->next->cell;
    struct Celula *b = stack->next->next->cell;
    struct Celula *pai = 0;
    if(stack->next->next->next)
        pai = stack->next->next->next->cell;
    if(pai)
        pai->esquerda = a;
    else {
        raiz = a;
    }
}

void reduz_S(struct Pilha *stack){
    struct Celula *a = stack->next->cell;
    struct Celula *b = stack->next->next->cell;
    struct Celula *c = stack->next->next->next->cell;
    struct Celula *pai = 0;
    struct Celula *app1, *app2, *app3;
    app1 = alocar_celula('@');
    app2 = alocar_celula('@');
    app3 = alocar_celula('@');
    app1->esquerda = app2;
    app1->direita = app3;
    app2->esquerda = a;
    app2->direita = c;
    app3->esquerda = b;
    app3->direita = c;
    if(stack->next->next->next->next)
        pai = stack->next->next->next->next->cell;
    if(pai){
        pai->esquerda = app1;
    }else{
        raiz = app1;
    }
}

void start(){
    while(1){
        struct Pilha *p = buscar_reduz(raiz);
        struct Celula *aux = p->cell;
        switch (aux->tipo){
            case 'K':
                if(!p->next || !p->next->next)
                    break;
                reduz_K(p);
                break;
            case 'S':
                if(!p->next || !p->next->next || !p->next->next->next)
                    break;
                reduz_S(p);
                break;
            default:

                break;
        }
    }
}

